export default function clickReducer(
    state = 0, action
) {
    if (action.type === 'boardClick') {
        console.log(action.x)
        console.log(action.y)
        console.log(state[action.x][action.y])
        return state + 1;
    }
    if (action.type === 'RESET') {
        return 0;
    }
    return state;
}
